Episode 1 - 8 and 2 clips of &quot;original&quot; strutter



Strutter is a show on MTV broadcast in the UK, Ireland, Spain, Romania, Sweden, Denmark, Norway and Finland. It stars Paul Kaye as Mike Strutter. 

The show focuses on clips of people getting hurt, Strutter making fun of music videos of indie bands, emo bands and boy bands, a German couple who like to mix extreme sports with sexual intercourse, and mock commercials promoting fictitious &quot;Struttergear&quot; merchandise.
